import React from "react";
import { Interest } from "../../../apis/model";

interface Props {
  interests: Interest[];
}

const Interests: React.FC<Props> = ({ interests }) => {
  return (
    <div>
      <h2>Interests</h2>
      <ul className="list">
        {interests
          .sort((a, b) => b.priority + a.priority)
          .map((interest, index) => {
            return <InterestItem {...{ interest }} key={index} />;
          })}
      </ul>
    </div>
  );
};
export default Interests;

const InterestItem = ({ interest }: { interest: Interest }) => {
  return (
    <li className="list-item">
      <p className="">{interest.type}</p>
    </li>
  );
};
